issues.body:
Hi!

I came upon this library while researching replacements for Vc. So far it's worked great, minus a few kinks here and there. However, the lack of intrinsics-backed casts produces a ~5x worse compute times on MSVC between Vc and xsimd-based implementations, even while accounting for hidden casts inside Vc. This performance hit can go as far as 100x if `/Ob1` or lower are used.

As an example:

```
template <bool aligned, class U = typename std::conditional<aligned, xsimd::aligned_mode, xsimd::unaligned_mode>::type>
static inline float_v fetch_alpha_32(const void *data)
{
  uint_v data_i =
      uint_v::load(reinterpret_cast<const uint_v::value_type *>(data), U{});
  return xsimd::batch_cast<float>(data_i >> 24); // this conversion goes through batch_cast(with_slow_conversion)
}
```

Instead of doing an aligned store, a compiler-managed copy, and an aligned load, it could be something as simple as `_mm256_cvtepi32_ps(self)`.
